description:
What would you do if a monster from the closet stole your teddy bear? Join one little girl on her Finding Teddy adventure. Enter a magical world of monsters and oddities, where solving riddles and puzzles will keep you alive. Experience this charmingly crafted tale through retro point-and-click gameplay and graphics. Will you be able to return to the real world? Start Finding Teddy today!

